# Pac-12 Conference

October 2011 - October 2013

The Pac-12 Conference is a college athletic conference, once home my alma mater &mdash; The University of Oregon. The conference expanded from the Pac-12 to 12 teams in 2011.

## Freelance Designer

October 2011 - October 2013

- PAC-12 Football Championship logo design
- Designed "12" numeral for PAC-12 logo
- PAC-12 Women's Basketball Championship logo design
